import React, { Component, Fragment } from 'react';
import Sinhvien from './Sinhvien';
import axios from "axios";
const config = require('../config.json');

export default class Sinhviens extends Component {

  state = {
    newsinhvien: null,
    sinhviens: []
  }

  fetchSinhviens = () => {
    // add call to AWS API Gateway to fetch products here
    // then set them in state
  }

  componentDidMount = () => {
    this.fetchSinhviens();
  }

  render() {
    return (
      <Fragment>
        <section className="section">
          <div className="container">
            <h1>Energy Products</h1>
            <p className="subtitle is-5">Invest in a clean future with our efficient and cost-effective green energy products:</p>
            <br />
            <div className="columns">
              <div className="column">
                <div className="tile is-ancestor">
                  <div className="tile is-4 is-parent  is-vertical">
                    { 
                      this.state.sinhviens && this.state.sinhviens.length > 0
                      ? this.state.sinhviens.map(product => <Sinhvien name={product.sinhvienname} date={product.date}
                        sex={product.sex} ethnic={product.ethnic} mssv={product.mssv} key={product.mssv} />)
                      : <div className="tile notification is-warning">No products available</div>
                    }
                  </div>
                </div>
              </div>
            </div>
          </div>
        </section>
      </Fragment>
    )
  }
}
